import styled from 'styled-components';
import { useTheme } from '@material-ui/core';

export default component => {
  const apply = styled(component);

  // const theme = useTheme();

  // console.log({ theme });

  return apply(`
      * {
        border: 0;
        margin: 0;
        padding: 0;
      }
    `);
};
